import React, { Component } from 'react';
import { View, StyleSheet, Animated, Image, TouchableOpacity } from 'react-native'

export default function Profile() {
    return (
        <View style={{ flexDirection: 'row', justifyContent:'space-between' }}>
            <View style={{ flexDirection: 'row', justifyContent: 'flex-start' }}>
                <View>
                    <Image style={styles.photo} source={require('E:/Upwork/React Native/AwesomeProject/assets/photo.png')} />
                    <Image style={styles.badge} source={require('E:/Upwork/React Native/AwesomeProject/assets/badge.png')} />
                </View>
                <Text style={styles.username}>Hengzhi Huang</Text>
            </View>

            <View style={{ flexDirection: 'row', justifyContent: 'flex-end' }}>
                <TouchableOpacity>
                    <View style={styles.rect}>
                        <Image style={styles.icon} source={require('E:/Upwork/React Native/AwesomeProject/assets/email.png')} />
                    </View>
                </TouchableOpacity>
            </View>
        </View>
    )
}

const styles = StyleSheet.create({
    photo: {
        width: 40,
        height: 40,
        borderRadius: 22
    },
    
    badge: {
        width: 14,
        height: 14,
        position: 'absolute',
        left: 28,
        top: 26,
    },

    rect: {
        width: 40,
        height: 40,
        backgroundColor: 'rgba(255, 255, 255 , 0.1)',
        borderRadius: 22,
        padding: 10,
    },

    icon: {
        width: 20,
        height: 20,
    },

    username: {
        marginLeft: 16,
        fontSize: 20,
        fontWeight: 700,
        color: '#F5F5F5'
    }
})
